const React = require('react')
const Default = require('./layout/default')

function Index ({seeds,title}) {
    return (
      <Default title={title}>
        <h2>Index Page</h2>
        {/* <p>I have {seeds[0].name} stuff!!!</p> */}
        <ul>
            {
                seeds.map((seeds)=>{
                    return(
                    <li key={seeds._id}>
                        <a href={`/plans/${seeds._id}`}>
                        {seeds.city}
                        
                        </a>
                    </li>
                    )
                })
            }
        </ul>
        <div className="newButton">

        <a href={`/plans/new`}> <button >Add a new bread</button></a>
</div>
  
      </Default>
    )
}

module.exports = Index

